<script type="text/javascript">
	function check_value(){
    	var pass = document.getElementById('password').value;
    	if (pass.length < 1) {
    		alert("  .");
    		return;
    	}
    	new UniSafeMail().unisafe_smail_process(pass);
    }

    	function onKeypressed(event){
		 if(event.which == 13){
			check_value();
		}			
		else{
			if(event.keyCode == 13){
				 check_value();
			}
		}
	}
        function focusInput(){
          	document.aform.password.focus();
        }
</script>
